        public static void createCrewMemberConfig(
            string scac, 
            string section, 
            string train_symbol, 
            string crew_id, 
            string crew_line_segment, 
            string sequence_number, 
            string crew_member_records,
            string originDate
        ) {

        	MIS_CrewMemberConfig crewMemberConfig = buildCrewMemberConfig(scac, section, train_symbol, crew_id, crew_line_segment, sequence_number, crew_member_records,originDate);

            string temp = System.Environment.GetEnvironmentVariable("TEMP");
            XmlSerializer serializer;
            FileStream fs;
            string request = "";


            CrewMemberConfig crewmemberconfig = crewMemberConfig.toSerializableObject();
            fs = File.Create(temp+"/temp.request");
            serializer = new XmlSerializer(typeof(CrewMemberConfig));
            var writer = new SteXmlTextWriter(fs);
            serializer.Serialize(writer, crewmemberconfig);
            fs.Close();

            request = File.ReadAllText(temp+"/temp.request");
            request = crewMemberConfig.toSteMessageHeader(request);
            System.IO.File.WriteAllText(SteUtils.getOutboundDir()+SteUtils.getFileName(), request);
        }

